import React from "react"

function ListTemplate({component: Component, data}) {
    return (
        <div>
            {data.map((dataItem) => (
                <div className="hStackContainer">
                    <div className="circle"></div>
                    <Component {...dataItem}/>
                </div>
            ))}
        </div>
    )
}

export default ListTemplate
